import React, { Component } from 'react';
import Moment from "moment";


export class issue_book extends Component {

    render() {


        return (
          <div>
            Issue book <br />
            
            <span className="number">
              {Moment(startdate, "DD-MM-YYYY").add("DD-MM-YYYY", 5)}
            </span>
          </div>
        );
    }
}

export default issue_book;
